import { __decorate } from "tslib";
import { Component } from '@angular/core';
import { environment } from 'src/environments/environment';
let RegisterComponent = class RegisterComponent {
    constructor(router, authService) {
        this.router = router;
        this.authService = authService;
        this.userObj = {
            name: "",
            mobile: "",
            type: "Developer",
            email: "",
            password: "",
            confirmPassword: "",
        };
        this.countryCode = '+91';
        this.error = "";
        this.userNameValid = true;
        this.phoneValid = true;
        this.emailValid = true;
        this.passValid = true;
        this.emailTitle = false;
        this.passTitle = false;
        this.userTitle = false;
        this.phoneTitle = false;
        this.roleTypeArr = environment.roleTypeArray;
        this.hide = true;
    }
    ngOnInit() {
        this.authService.autoAuthUser();
        let auth = this.authService.getAuthStatus();
        if (auth) {
            this.router.navigate(['/']);
        }
    }
    onUserNameKeyUp() {
        this.userTitle = true;
        if (this.userObj.name.length > 30 ||
            this.userObj.name.length < 5)
            this.userNameValid = false;
        else
            this.userNameValid = true;
    }
    onPhoneKeyUp() {
        this.phoneTitle = true;
        if (this.userObj.mobile.toString().length != 10)
            this.phoneValid = false;
        else
            this.phoneValid = true;
    }
    onEmailKeyUp() {
        this.emailTitle = true;
        var mailformat = /^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/;
        if (this.userObj.email.match(mailformat))
            this.emailValid = true;
        else
            this.emailValid = false;
    }
    onPassKeyUp() {
        this.passTitle = true;
        if (this.userObj.password.length > 20 ||
            this.userObj.password.length < 6)
            this.passValid = false;
        else
            this.passValid = true;
    }
    async onRegister() {
        if (this.userObj.name != '' && this.userObj.mobile != '' && this.userObj.email != '' && this.userObj.password != '' && this.userObj.type != '' && this.userObj.confirmPassword != ''
            && this.userNameValid && this.phoneValid && this.emailValid && this.passValid && this.userObj.type && this.userObj.confirmPassword == this.userObj.password) {
            const regForm = {
                name: this.userObj.name,
                mobile: this.userObj.mobile,
                email: this.userObj.email,
                password: this.userObj.password,
                type: this.userObj.type,
            };
            await this.authService.register(regForm);
        }
    }
};
RegisterComponent = __decorate([
    Component({
        selector: 'app-register',
        templateUrl: './register.component.html',
        styleUrls: ['./register.component.scss']
    })
], RegisterComponent);
export { RegisterComponent };
